import styled from "styled-components"
import { useEffect, useState } from 'react'
// import './shoppingCart.css';


const ShoppingCart = () => {

    return (
        <Container>
            <WrapperTitle>
                <Title>Item was successfully added to your cart</Title>
            </WrapperTitle>
            <Table>
                <THead>
                    <Tr>
                        <Td>QTY</Td>
                        <Td>PHOTO</Td>
                        <Td>TITLE</Td>
                        <Td>PRICE</Td>
                        <Td>TOTAL</Td>
                    </Tr>
                </THead>
                <TBody>
                    <Tr>
                        <Td>2</Td>
                        <Td><Img src="https://chamisalvineyards.com/wp-content/uploads/2018/06/CV-morrito-pinot-WP_705x214.png" alt="" /></Td>
                        <Td>TITLE</Td>
                        <Td>PRICE</Td>
                        <Td>TOTAL</Td>
                    </Tr>
                </TBody>
            </Table>
            <SubTotal>SUBTOTAL 121212</SubTotal>
            <ButtonCart>VIEW CART</ButtonCart>
        </Container>
    )
}

const Container = styled.div`

`

const WrapperTitle = styled.div`
    margin-top: 20px;
    background-color: #C6D7D5;
    padding: 20px;
    margin-bottom: 20px;
`

const Title = styled.h2`
    color: #4e4540;
    font-size: 12px;
    font-weight: bold;
    letter-spacing: 2px;
    text-align: center;
    text-transform: uppercase;
    font-family: 'Brandon Grotesque';
`

const Table = styled.table`
    width: 100%;
    margin-bottom: 20px;
`

const THead = styled.thead`
    border-bottom: 2px solid rgba(0, 0, 0, 0.5);
    color: red;
    padding-bottom: 10px;
`

const Tr = styled.tr`

`

const Td = styled.th`
    font-family: 'Source Sans Pro';
`

const Img = styled.img`
    width: 10px;
`

const TBody = styled.tbody`

`

const SubTotal = styled.p`

`

const ButtonCart = styled.button`

`

export default ShoppingCart
